import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [activeButton, setActiveButton] = useState(null);

  // Questions for each button
  const questions = {
    button1: ["Do you have any tooth pain?", "Do you have sensitive gums?", "Are your gums bleeding?"],
    button2: ["Do you brush your teeth twice a day?", "Do you floss regularly?", "Have you visited a dentist in the last 6 months?"],
    button3: ["Do you have any dental implants?", "Are you wearing braces?", "Do you have a history of gum disease?"],
  };

  // Handle button click to set active button and show relevant questions
  const handleButtonClick = (button) => {
    setActiveButton(button);
  };

  return (
    <div className="App">
      <Navbar />
      <Header />

      {/* Section for buttons */}
      <div className="section-buttons">
        <button className="button-link" onClick={() => handleButtonClick("button1")}>Questions 1</button>
        <button className="button-link" onClick={() => handleButtonClick("button2")}>Questions 2</button>
        <button className="button-link" onClick={() => handleButtonClick("button3")}>Questions 3</button>
      </div>

      {/* Section for questions */}
      <div className="question-list">
        {activeButton && (
          <>
            <h3>Answer the following questions:</h3>
            {questions[activeButton].map((question, index) => (
              <div key={index} className="question-item">
                <label>
                  <input type="checkbox" /> {question}
                </label>
              </div>
            ))}
          </>
        )}
      </div>

      <Footer />
    </div>
  );
};

const Navbar = () => (
  <nav className="navbar">
    <div className="navbar-left">
      <h2>Dental App</h2>
    </div>
    <div className="navbar-center">
      <ul className="nav-links">
        <li className="nav-item"><a href="#">Home</a></li>
        <li className="nav-item"><a href="#">About</a></li>
        <li className="nav-item"><a href="#">Contact</a></li>
      </ul>
    </div>
    <div className="navbar-right">
      <button className="login-btn">Login</button>
    </div>
  </nav>
);

const Header = () => (
  <header className="header">
    <h1>Welcome to the Dental App</h1>
  </header>
);

const Footer = () => (
  <footer className="footer">
    <p>&copy; 2024 Dental App. All rights reserved.</p>
  </footer>
);

export default App;
